onClipEvent (load) {
	_visible = false;
	onMouseDown = function () {
		if (this.hitTest(_root._xmouse, _root._ymouse, true)) {
			_parent.page = "P0";
			_parent.play();
		}
	};
}

onClipEvent (load) {
	if (_root.TotalStars == 0 || (_root.Star[41] == false && _root.BowserKey1 == true)) {
		_alpha = 30;
	} else {
		_visible = false;
	}
	onMouseDown = function () {
		if (this.hitTest(_root._xmouse, _root._ymouse, true) && _root.TotalStars>=1 && !(_root.Star[41] == false && _root.BowserKey1 == true)) {
			_root.starwarpframe = false;
			_root.Blackout();
			onEnterFrame = function () {
				if (_root.starwarpframe == true) {
					_root.newstar = true;
					_root.LastItemGot = "Exit";
					_root.ReturnToCastle();
				}
			};
		} else if (_root.TotalStars == 0) {
			// Error Noise
		}
	};
}

