onClipEvent (enterFrame) {
	if (_root.Fluddpow == "") {
		gotoAndStop(4);
	} else if (_root.Fluddpow == "T") {
		gotoAndStop(3);
	} else if (_root.Fluddpow == "R") {
		gotoAndStop(2);
	} else if (_root.Fluddpow == "H") {
		gotoAndStop(1);
	}
}

